import React, { useState } from "react";
import {
  Chart as ChartJS,
  LineElement,
  CategoryScale,
  LinearScale,
  PointElement,
  Tooltip,
  Legend,
} from "chart.js";
import { Line } from "react-chartjs-2";
import universityData from "./UniversityData";

ChartJS.register(
  LineElement,
  CategoryScale,
  LinearScale,
  PointElement,
  Tooltip,
  Legend
);

const App = () => {
  const [selectedUniversity, setSelectedUniversity] = useState("");
  const [selectedSubject, setSelectedSubject] = useState("");
  const [studentType, setStudentType] = useState("International");

  const handleUniversityChange = (e) => {
    setSelectedUniversity(e.target.value);
    setSelectedSubject(""); // reset subject on university change
  };

  const handleSubjectChange = (e) => {
    setSelectedSubject(e.target.value);
  };

  const handleStudentTypeChange = (e) => {
    setStudentType(e.target.value);
  };

  const university = universityData.find(
    (u) => u.name === selectedUniversity
  );

  const subjectData =
    university?.subjects.find((s) => s.name === selectedSubject) || null;

  const chartData = {
    labels: subjectData?.rankings?.map((r) => r.year) || [],
    datasets: [
      {
        label: `${selectedSubject} QS Rank`,
        data: subjectData?.rankings?.map((r) => r.rank) || [],
        fill: false,
        borderColor: "#007bff",
        tension: 0.3,
      },
    ],
  };

  const chartOptions = {
    scales: {
      y: {
        beginAtZero: false,
        ticks: {
          precision: 0, // remove decimals
        },
      },
    },
  };

  return (
    <div style={{ padding: "20px", fontFamily: "Arial" }}>
      <h2>QS World University Rankings Explorer</h2>

      {/* University Selection */}
      <label>Select University: </label>
      <select value={selectedUniversity} onChange={handleUniversityChange}>
        <option value="">-- Select --</option>
        {universityData.map((u) => (
          <option key={u.name} value={u.name}>
            {u.name}
          </option>
        ))}
      </select>

      {/* Student Type */}
      {university && (
        <div style={{ marginTop: "10px" }}>
          <label>
            <input
              type="radio"
              name="studentType"
              value="International"
              checked={studentType === "International"}
              onChange={handleStudentTypeChange}
            />
            International
          </label>
          <label style={{ marginLeft: "10px" }}>
            <input
              type="radio"
              name="studentType"
              value="Domestic"
              checked={studentType === "Domestic"}
              onChange={handleStudentTypeChange}
            />
            Domestic
          </label>
        </div>
      )}

      {/* Subject Dropdown */}
      {university && (
        <div style={{ marginTop: "15px" }}>
          <label>Subject: </label>
          <select value={selectedSubject} onChange={handleSubjectChange}>
            <option value="">-- Select Subject --</option>
            {university.subjects.map((s) => (
              <option key={s.name} value={s.name}>
                {s.name}
              </option>
            ))}
          </select>
        </div>
      )}

      {/* Subject Details */}
      {subjectData && (
        <div style={{ marginTop: "25px", padding: "15px", border: "1px solid #ccc", borderRadius: "10px" }}>
          <h3>{selectedSubject}</h3>
          <p><strong>QS Subject Ranking:</strong></p>
          <ul>
            {subjectData.rankings.map((r) => (
              <li key={r.year}>
                {r.year}: Rank {r.rank}
              </li>
            ))}
          </ul>

          <p><strong>Intake(s):</strong> {subjectData.intakes}</p>
          <p><strong>Application Deadline:</strong> {subjectData.deadline}</p>
          <p><strong>Fees:</strong> ₹{subjectData.fees[studentType]}</p>
          <p><strong>Eligibility:</strong> {subjectData.eligibility[studentType]}</p>

          <div style={{ width: "400px", height: "250px", marginTop: "30px" }}>
            <Line data={chartData} options={chartOptions} />
          </div>
        </div>
      )}
    </div>
  );
};

export default App;
